css:
@-moz-document domain('wikipedia.org'){
body, #content, .ambox th.mbox-text, .ambox td.mbox-text, div.thumbinner
{
	background-image: url(data:image/png;base64,);
    background-color: #262626;
}

div#mw-head, div.vectorTabs span > a
{
	background-image: url(data:image/png;base64,);
    background-color: #1F1F1F;
}

div.vectorTabs span > a
{
	color: #F0F0F0;
}

.central-featured-lang *
{
	color: #F0F0F0;
}

b
{
	color: #567E3A;
}

mw-headline
{
	color: black;
}

a, a:active, a:focus, .mw-body a.external
{
	color: #75A1D0;
}

div, h1, h2, h3, h4, h5, h6, p, label, span
{
	color: #F0F0F0;
}

div#mw-panel div.portal div.body ul li a:visited,
div#mw-panel div.portal div.body ul li a
{
	color: #F0F0F0; 
}

div#mw-panel div.portal h3
{
	color: #778899;
}

#toc, table.wikitable, table, table.wikitable > tr > th, table.wikitable > * > tr > th, .infobox, .vcard, .toccolours
{
    background-image: url(data:image/png;base64,) !important;
    background-color: #1F1F1F !important;
    color: #F0F0F0 !important;
}

table { border-collapse: collapse; }

td
{
	background-image: url(data:image/png;base64,) !important;
    background-color: #0E0E0E !important;
    color: #F0F0F0 !important;
    border: 1px solid white !important;
    padding: 3px !important;
}

a.new
{
	color: #39B7CD;
}

caption
{
	color: #F0F0F0;
}

.highlight
{
	color: #65909A;
}

.mw-content-ltr .thumbcaption
{
background-image: url(data:image/png;base64,);
    background-color: #080808;
}
}
